INSERT INTO `frs_help` (`help_id`, `anchor_id`, `text`, `all_states_flag`)
VALUES
	(2,11,'<p> Receipt of child support may affect the family&rsquo;s eligibility for certain work supports. Also, if the family is receiving TANF cash assistance benefits, some or all of this money may be withheld by the state, depending on state policy. </p><p>For the DC 2017 simulator, when a family receives <b>child support</b>, the simulator assumes the level of child support is based on a formula for court-ordered child support in the District of Columbia. It also assumes that all child support comes from only one non-custodial parent, and that the non-custodial parents income is constant and includes interest. See our <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for more information.',1),
	(66,58,'<p>Enter <b>starting wage rate</b>. The starting wage rate is used to calculate how many hours parents are working at a given earnings level &mdash; and thus determine when parents begin full-time work. Additional earnings increases are attributed to hours or hourly wages.</p> <br/> <p> Prior to 2010, the default value for state simulators is the state\'s 20th percentile wage rate &mdash; i.e., 80% of the states workers earn a higher wage, and 20% earn a lower wage. All Simulators from 2010 forward (except Mississippi 2010) use the 25th percentile wage rate.</p>\r\n',0),
	(21,9,'<p>The simulator provides three \"traditional\" options for the <b>employment of second parent</b>: \"full time,\" meaning up to 40 hours per week, \"part time,\" meaning up to 20 hours per week, and \"not employed,\' meaning that the second parent does not earn wages For parents with \"traditional\" schedules, it is assumed that the second parent only begins working once the first parent works 40 hours per week. </p> <p> Beginning in 2017, users selecting to model \"nontraditional\" schedules can select different values for the number of hours the second parent works in a week. </p>',0),
	(4,12,'Savings may affect the family\'s eligibility for certain work supports. Also, if the family has more than $5,000 in savings, the Simulator will assume that the family earns a small amount of interest.',1),
	(6,14,'Enter <b>amount family owes on car</b>. This will be subtracted from the car\'s value to determine the \"equity value\" of the vehicle, which may affect eligibility for certain work supports.',1),
	(65,18,'<p>Select <b>work supports</b> to indicate which work supports the family should receive when eligible. For information about how the Simulator determines eligibility, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_eligibility\">Assumptions for Determining Work Support Eligibility</a>.</p>',0),
	(61,6,'The number and ages of a family\'s children will affect the family\'s child care needs (e.g., the Simulator assumes that children ages 13 and above do not need paid child care) and may also affect eligibility for certain work supports.',0),
	(10,29,'<p><b>Select child care setting</b>. Rates are based on provider payment rates in the state\'s child care subsidy program assuming full-time care for preschool-aged children (under age 6) and part-time care for school-age children (ages 6 through 12). The Simulator will adjust the rates when parents are working less than full-time. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_child_care\">Estimating Family Child Care Needs</a>.</p>',0),
	(11,30,'<p><b>Enter cost per child</b>. This amount should reflect the cost of care when parents are working full-time. The Simulator will adjust the cost when parents are working fewer hours. The cost for school-aged children (ages 6 through 12) should be based on part-time care. To indicate that parents do not pay for care, enter $0. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_child_care\">Estimating Family Child Care Needs</a>.</p>',0),
	(12,33,'<p><b>Select setting for subsidized child care</b>. Families must meet income eligibility criteria &mdash; and, in some states, minimum work hour requirements &mdash; to qualify for subsidies.</p> ',0),
	(14,37,'<p><b>Select child care setting</b> for unsubsidized care when family loses child care subsidies. Rates are based on data from the states child care market rate survey or provider payment rates in the state\'s child care subsidy program assuming full-time care for preschool-aged children (under age 6) and part-time care for school-age children (ages 6 through 12). The Simulator will adjust the rates when parents are working less than full-time. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_child_care\">Estimating Family Child Care Needs</a>.</p>',1),
	(15,38,'<p><b>Enter cost per child</b> for unsubsidized care when family loses child care subsidies. This amount should reflect the cost of care when parents are working full-time. The Simulator will adjust the cost when parents are working fewer hours. The cost for school-aged children (ages 6 through 12) should be based on part-time care. To indicate that parents do not pay for care, enter $0. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_child_care\">Estimating Family Child Care Needs</a>.</p>',0),
	(68,56,'<b>Child Health Plus B</b> is the name of one of New Yorks public health insurance plans for children; children ineligible for public coverage may also enroll in this plan if they pay the full (unsubsidized) premium.',0),
	(80,40,'<b>Choose private health insurance option when family loses public coverage.</b>  Income eligibility limits for public health insurance are lower for parents than for children, so at some earnings levels, children have access to public coverage while parents need a private plan. For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>. ',1),
	(73,50,'<p>Enter <b>transportation expenses: other cost estimate</b>. This amount should reflect the cost of transportation when parents are working full-time. The Simulator will adjust the cost when parents are working fewer hours.</p> <br/> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p>',1),
	(70,40,'<p><b>Choose private health insurance option when family loses public coverage.</b> Income eligibility limits for public health insurance are lower for parents than for children, so at some earnings levels, children have access to public coverage while parents need a private plan. For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p><br/><p>New York offers a state-subsidized plan called Healthy NY to working adults (and spouses) who do not have an employer-based plan, are ineligible for free public coverage, and have income below about 250% of the poverty level. The Simulator assumes that eligible parents are covered by Healthy NY (and pay relevant premiums) if \"nongroup plan\" &mdash; or an \"other cost estimate\" that is more expensive than Healthy NY &mdash; is selected.</p>',0),
	(46,3,'The Family Resource Simulator assumes the household contains only those family members listed. It also assumes that no family member is pregnant, disabled,  elderly, retired, or serves/d in the military.',0),
	(47,57,'<p>Enter <b>starting wage rate</b>. The starting wage rate is used to calculate how many hours parents are working at a given earnings level &mdash; and thus determine when parents begin full-time work. Additional earnings increases are attributed to hours or hourly wages.</p> <br/> <p> Prior to 2010, the default value for state simulators is the state\'s 20th percentile wage rate &mdash; i.e., 80% of the states workers earn a higher wage, and 20% earn a lower wage. All Simulators from 2010 forward (except Mississippi 2010) use the 25th percentile wage rate.</p>\r\n',0),
	(63,13,'The value of a family\'s car may affect eligibility for certain work supports.',0),
	(92,40,'<p><b>Choose private health insurance option.</b> For more information, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.</p><br/><p>Children in Illinois are eligible for public health insurance regardless of family income, but at higher income levels, premiums may exceed the cost of private coverage. Public coverage for parents is subject to income limits. The Simulator assumes parents shift to private coverage when ineligible for public, and children switch when it is cheaper to do so. If the family does not have access to private insurance, parents will become uninsured when ineligible for public coverage, while children will remain in public coverage and pay relevant premiums.</p></br><p>',0),
	(84,45,'<b>Choose private health insurance option.</b> For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.',1),
	(125,76,'<p>The <b>Catamount Health Assistance Program</b> is a state-subsidized premium assistance program for adults. Participants must have income below 300% of the poverty level and be ineligible for other state programs.</p><br/>\r\n<p>If selected, the Simulator assumes that eligible parents are covered by Catamount (and pay relevant premiums) when the premium costs less than the private health plan premium selected on Simulator Step 6. Note that the Simulator only allows Catamount to be selected when \"Public Health Insurance (Medicaid, SCHIP)\" is selected as well.</p>',0),
	(86,47,'<b>Select Family Resource Simulator estimate or enter your own estimate.</b> For more information about the Simulator&rsquo;s expense estimates, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.',0),
	(94,71,'<b>MediKids</b> and <b>Healthy Kids</b> are the names of public health insurance plans for children in Florida (MediKids covers children up to age 6; Healthy Kids covers children ages 6 and up). Children ineligible for public coverage may also enroll in these plans if they pay the full (unsubsidized) premium.',0),
	(97,73,'Enter monthly <b>additional out-of-pocket medical expenses</b>. The cost estimates provided on this page for employer-based and nongroup health insurance plans include premiums only.',1),
	(102,74,'Enter monthly <b>additional out-of-pocket medical expenses</b>. The cost estimates provided on this page for employer-based and nongroup health insurance plans include premiums only.',1),
	(111,50,'<p>Enter <b>transportation expenses</b>. This amount should reflect the cost of transportation when parents are working full-time. The Simulator will adjust the cost when parents are working fewer hours.</p> <br/> <p>The Simulators default estimate assumes that parents commute by car, except in Seattle/King County where the estimate is based on public transportation. For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p> <br/> <p>The Simulator\'s cost estimate for <i>private</i> transportation in Seattle/King County would be $272 per month for a single parent ($401 per month for two parents).</p>',0),
	(108,76,'<p><b>Washington Basic Health</b> is a state-subsidized plan for families with income below 200% of the poverty level. Participants pay premiums and copayments and enrollment is capped. While less expensive coverage through Medicaid or SCHIP is generally available to eligible children, this program expands parents\' access to public coverage.</p><br/><p>If selected, the Simulator assumes that eligible parents are covered by Basic Health (and pay relevant premiums) when they are ineligible for Medicaid and the Basic Health premium costs less than the private health plan premium selected on Simulator Step 6.  Note that the Simulator only allows Basic Health to be selected when \"Public Health Insurance (Medicaid, SCHIP)\" is selected as well.</p>',0),
	(110,78,'<p><b>Income taxes (includes credits)</b> reflects the family\'s total federal, state, and local income tax liability. It includes the value of income tax credits, such as federal and state Earned Income Tax Credits (EITCs) and child care tax credits. When the value of these credits exceeds the family\'s gross income tax liability, income taxes will be negative.</p> <br/> <p>To see a breakdown of the family\'s income tax liability, click [show detail].</p>',1),
	(112,22,'<p>If <b>Public Health Insurance</b> is selected, the Simulator assumes that family members have public coverage (and pay relevant premiums) when eligible for a state Medicaid or SCHIP plan.</b> </p><br/><p>If you select <b>Public Health Insurance</b>, you also have the option to select <b>Washington Basic Health</b>.</p>',0),
	(130,76,'The <b>Catamount Health Assistance Program</b> is a state-subsidized program for individuals 18 years old and older. Premium assistance is provided for individuals with incomes below 300% FPL who are ineligible for other state-subsidized programs and have been uninsured for at least 12 months.',0),
	(126,79,'Are <b>children in care that qualifies for refundable credit</b>? Vermont has two child care tax credits, but tax filers can only claim one. There\'s a nonrefundable credit of 24% of the federal child and dependent care tax credit that\'s available to everyone who qualifies for the federal credit. There\'s also a refundable credit of 50% of the federal credit, but filers must meet an income limit and child care expenses must be for a \"qualified\" child care provider. \"Qualified\" providers include those with national accreditation or with three or more stars from the state\'s rating system; only a small minority of providers meet these criteria.',0),
	(117,29,'<p><b>Select child care setting</b>. Rates are based on data from the states child care market rate survey, assuming full-time care for preschool-aged children (under age 6) and part-time care for school-age children (ages 6 through 12). The Simulator will adjust the rates when parents are working less than full-time. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p>',0),
	(119,37,'<p><b>Select child care setting</b> for unsubsidized care when family loses child care subsidies. Rates are based on data from the states child care market rate survey, assuming full-time care for preschool-aged children (under age 6) and part-time care for school-age children (ages 6 through 12). The Simulator will adjust the rates when parents are working less than full-time. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p>',0),
	(121,22,'<p>If <b>Public Health Insurance</b> is selected, the Simulator assumes that family members have public coverage (and pay relevant premiums) when eligible for a state Medicaid or SCHIP plan.</b> </p><br/><p>.</p>',0),
	(182,29,'<p><b>Select child care setting</b>. Rates are based on data from the states child care market rate survey, assuming full-time care for preschool-aged children (under age 6) and part-time care for school-age children (ages 6 through 12). The Simulator will adjust the rates when parents are working less than full-time. Beginning in July 2011, California\'s child care subsidy is available for children through age 10. Although 11 and 12 year olds are no longer eligible for subsidized care, the Simulator assumes they need part time care. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p>',0),
	(123,76,'<p><b>IowaCare</b> is a state-subsidized plan for families with income below 200% of the poverty level. Participants pay premiums and copayments. While less expensive coverage through Medicaid or SCHIP is generally available to eligible children, this program expands parents\' access to public coverage.</p><br/>\r\n<p>If selected, the Simulator assumes that eligible parents are covered by IowaCare (and pay relevant premiums) when they are ineligible for Medicaid and the IowaCare premium costs less than the private health plan premium selected on Simulator Step 6. Note that the Simulator only allows IowaCare to be selected when \"Public Health Insurance (Medicaid, SCHIP)\" is selected as well.</p>',0),
	(132,42,'The <b>nongroup plan</b> cost estimates are derived from the Catamount Full Premium health insurance plan, which is offered through Blue Cross Blue Shield and MVP Vermont. ',0),
	(135,80,'The <b>nongroup plan</b> cost estimate is derived from the Catamount Full Premium health insurance plan; this plan is not subsidized by the state and is offered through Blue Cross Blue Shield and MVP Vermont.',0),
	(137,51,'<b>Cost of other necessities</b> takes into account the Lifeline Telephone Service Credit. The Lifeline program provides a credit of about $13.50 per month on the telephone bills of Vermont residents with income below $20,535/year. Recipients must apply each year to receive the credit. ',0),
	(140,80,'Test help text for page6_nobenefit_nongroup anchor',0),
	(142,82,'Through the <b>Low-Income Home Energy Assistance Program</b>, Vermont provides Seasonal Fuel Assistance to families with income up to 125% of the federal poverty level. Crisis and emergency fuel assistance is also provided on a  case-by-case basis (with somewhat higher income limits), but these  programs are not reflected in Simulator results. ',0),
	(148,84,'<b>Premium Assistance For Kids</b> (PAK) is a state-subsidized premium\r\nassistance program for children under age 12 or up to age 18 if they\r\nhave a sibling under age 12.  Participants must have income above 235%\r\nof the poverty level and be ineligible for Medicaid and SCHIP. </p> <br /> <br /> <p>\r\n\r\nIf selected, the Simulator assumes that eligible children are\r\ncovered by PAK (and pay relevant premiums) when they are ineligible for\r\nMedicaid and SCHIP and the PAK premium costs less than the private\r\nhealth plan selected on Simulator Step 6. Note that the\r\nSimulator only allows PAK to be selected when \"Public Health Insurance\r\n(Medicaid, SCHIP)\" is selected as well. ',0),
	(149,83,'<b>State Coverage Insurance</b> (SCI) is a state-subsidized premium assistance\r\nprogram for adults. Participants must have income below 200% of the\r\npoverty level and be ineligible for other public and private health\r\ninsurance programs. </p> <br /> <br /> <p>\r\n\r\nIf selected, the Simulator assumes that eligible parents are covered\r\nby SCI (and pay relevant premiums) when they are ineligible for Medicaid\r\nand the SCI premium costs less than the private health plan selected on Simulator Step 6. Note that the Simulator only allows SCI to be selected when \"Public Health Insurance (Medicaid, SCHIP)\" is selected\r\nas well. </p> <br />\r\n\r\nEnrollment in this program was closed as of September 2008.\r\n',0),
	(151,85,'<b>School Readiness Credit</b> is a state tax credit available to families with at least one child under the age of six. The child must have attended a child care center that has earned at least two stars in the states quality rating program (the value of the credit increases with the number of stars). </p> <br /> <br /> <p>\r\nNote that while in practice, the credit is limited to children enrolled in center-based care, if this benefit is selected, the Simulator will assume that any child under age 6 is eligible regardless of the care choices made on Step 5.',0),
	(154,87,'<p><b>Enter cost per child</b> for subsidized care. This amount should reflect the cost of care when parents are working full-time. The Simulator will adjust the cost when parents are working fewer hours. The cost for school-aged children (ages 6 through 12) should be based on part-time care. To indicate that parents do not pay for care, enter $0. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_child_care\">Estimating Family Child Care Needs</a>.</p>',0),
	(155,86,'<p><b>Select setting for subsidized care</b>. Rates are based on data from the states child care market rate survey assuming full-time care for preschool-aged children (under age 6) and part-time care for school-age children (ages 6 through 12). The Simulator will adjust the rates when parents are working less than full-time. </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_child_care\">Estimating Family Child Care Needs</a>.</p>',0),
	(157,33,'<p><b>Select setting or enter cost for subsidized child care</b>. Families must meet income eligibility criteria &mdash; and, in some states, minimum work hour requirements &mdash; to qualify for subsidies.</p> ',0),
	(159,22,'<p><b>MassHealth</b> is a subsidized health insurance program for residents with incomes less than 300% of the poverty level.  It includes several coverage plans for families with children including Medicaid and CHIP.</p><br>\r\n<p> If selected, the Simulator assumes that eligible children are covered by Children\'s Medical Security Plan (and pay relevant premiums) when ineligible for MassHealth Family Assistance (CHIP) and MassHealth Standard (Medicaid).  It also assumes that parents are covered by CommonWealth Care (and pay relevant premiums) when they are ineligible for MassHealth Standard (Medicaid) and the CommonWealth Care premium costs less than the private health plan selected on Simulator Step 6.</p>',0),
	(160,42,'The <b>nongroup plan</b> cost estimates are derived from the CommonWealth Choice health insurance plan, which is offered through several insurance carriers. ',0),
	(164,88,'<p>The <b>Massachusetts Rental Voucher Program (MRVP)</b> is a state-subsidized program that offers rental subsidies to families and individuals with incomes less than 200% of the poverty level.</p><br>\r\n<p>If selected, the Simulator assumes eligible families receive the Mobile tenant based voucher. Voucher values depend on the tenant\'s income, household size, and region.</p><br>\r\n<p>Note that due to current budget constraints, the MRVP\'s Mobile component is frozen and new vouchers are not being issued</p>',0),
	(167,80,'The <b>nongroup plan</b> cost estimates are derived from the CommonWealth Choice health insurance plan, which is offered through several insurance carriers. ',0),
	(178,58,'<p>Enter <b>starting wage rate</b>. The simulator models net resources over a range of earnings. To calculate earnings, it increases family income by first increasing the number of hours by any working parents in the household, based on the starting wage rate. When a family\'s earnings exceeds the maximum hours that parents work in a week multiplied by that starting wage rate, the simulator attributes those higher earnings to higher wages, not more working hours.</p>  <p> For DC 2017, the default starting wage is the district\'s minimum wage. Prior to 2010, the default value for state simulators is the state\'s 20th percentile wage rate  i.e., 80% of the states workers earn a higher wage, and 20% earn a lower wage. Simulators from 2010-2015 (except Mississippi 2010) use the 25th percentile wage rate. See the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for more information.</p>',1),
	(179,57,'<p>Enter <b>starting wage rate</b>. The simulator models net resources over a range of earnings. To calculate earnings, it increases family income by first increasing the number of hours by any working parents in the household, based on the starting wage rate. When a family\'s earnings exceeds the maximum hours that a parent works in a week multiplied by that starting wage rate, the simulator attributes those higher earnings to higher wages, not more working hours. \r\n<p> For DC 2017, the default starting wage is the district\'s minimum wage. Prior to 2010, the default value for state simulators is the state\'s 20th percentile wage rate  i.e., 80% of the states workers earn a higher wage, and 20% earn a lower wage. Simulators from 2010-2015 (except Mississippi 2010) use the 25th percentile wage rate. See the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for more information.</p> <br/>',1),
	(184,37,'<p><b>Select child care setting</b> for unsubsidized care when family loses child care subsidies. Rates are based on data from the states child care market rate survey or provider payment rates in the state\'s child care subsidy program assuming full-time care for preschool-aged children (under age 6) and part-time care for school-age children (ages 6 through 12). The Simulator will adjust the rates when parents are working less than full-time. \r\n\r\nNote that as of July 2011, California no longer subsidizes child care for 11 and 12 year-olds. The Simulator still assumes a need for part-time child care for 11 and 12-year olds.  </p> <br /> <p>For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_child_care\">Estimating Family Child Care Needs</a>.</p>',0),
	(185,50,'<p>Enter <b>transportation expenses</b>. This amount should reflect the cost of transportation when parents are working full-time. The Simulator will adjust the cost when parents are working fewer hours.</p> <br/> <p>The Simulators default estimate assumes that parents commute by car, except in San Francisco where the estimate is based on public transportation. The Simulator\'s cost estimate for <i>private</i> transportation in San Francisco would be $306 per month for a single parent ($405 per month for two parents). For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p> <br/>',0),
	(186,50,'<p>Enter <b>transportation expenses</b>. This amount should reflect the cost of transportation when parents are working full-time. The Simulator will adjust the cost when parents are working fewer hours.</p> <br/> <p>The Simulators default estimate assumes that parents commute by car, except in cities with a comprehensive transit system. For more information, see <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.</p> <br/>',1),
	(187,11,'Delete Or Reuse ',0),
	(191,3,'<p>This text is intended to help answer some questions users might have about what the simulator asks. For example, throughout the simulator, the term \"<b>parent</b>\" can be understood to mean \"parent or guardian.\" We assume that parents or guardians in a two-parent family are married, and the mother is in the household if any child is listed as under 1 year old. </p>\r\n<p>We ask questions about breastfeeding, disability, and child support to help estimate benefits and expenses. In terms of <b>disability</b>, the simulator assumes that no one in the family is blind. We also assume that <b>child support</b> comes from only one non-custodial parent. If you wish to model a family in which at least one parent works outside of a 9am-5pm, Monday-Friday schedule, select Yes for the question about <b>nontraditional</b> work schedules.</p>\r\n<p>For additional information about these questions and how the simulator works, please see our <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.</p>',0),
	(197,47,'In this section, users can select standard costs for <b>rent, utilities, food, transportation,</b> and <b>other expenses,</b> or enter their own estimates. These costs represent unsubsidized expenses, but benefits like Section 8 or reduced-price meal programs can reduce these costs.<br>\r\nPlease note that because of how federal Fair Market Rents are calculated, users can only override the simulators <b>energy cost estimates</b> if they have already selected to enter an alternate rental cost. <br>\r\nAlso, while <b>transportation </b>for the District of Columbia is based on the cost of public transportation, alternate amounts that users enter should be the cost of transportation when working full-time; the simulator will adjust the cost if any parent works less than full-time. <br>\r\nIf at least one adult in the household is disabled, <b>additional disability-related expenses </b>cover expenses not covered in previous steps, including expenses for caring for a disabled spouse if the spouse does not work (like costs for in-home care), and expenses that enable a disabled family member to be employed (like assistive technology).\r\n\r\nSee the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for more information on these questions and our methodology.<br>\r\n\r\n',0),
	(211,40,'   If you selected public health insurance in Step 4, your selection below for private health insurance applies to the family only when they reach incomes greater than public health insurance eligibility levels. Income eligibility limits for public health insurance are lower for parents than for children, so at some earnings levels, children have access to public coverage while parents need a private plan.<br>\r\n    If you did not select public health insurance, your selection below reflects health insurance costs across all earnings levels. These cost estimates are for premiums only, not copayments or other out-of-pocket expenses, and do not include premium tax credits.<br>\r\nFor more information about how the simulator calculates health care costs, please see the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.\r\n\r\n\r\n',0),
	(198,49,'The simulators default setting is based on the USDA Food Plans which represent a nutritious diet at four different cost levels: thrifty, low-cost, moderate, and liberal. They are derived from average national prices of commonly consumed foods and depends on family size and ages. For example, in March 2017, the monthly cost of food for a family of 4 was $710.30 on the low-cost plan.',0),
	(199,50,'In D.C., the default setting estimates transportation costs for parents using the average round trip price at peak hour fares for Metrorail ($8.06/roundtrip). The FRS estimate is half the amount for a disabled parent.',0),
	(200,51,'Other necessities are the familys expenses for items and services not already captured such as clothing, personal care items, and household repairs. The simulators default setting for 2017 sets other necessities equal to 34 percent of the sum of unsubsidized rent, utilities, and food costs at all earnings levels. (e.g., ~$786 per month for a two-parent family with two kids). This method is adapted from the Economic Policy Institutes method which uses data from the Bureau of Labor Statistics Consumer Expenditure Survey.\r\n',0),
	(201,48,'If you selected Section 8 subsidies in Step 4, the Fair Market Rent (FMR) is the familys rent cost when they are no longer eligible for Section 8.  In many states, landlords of Section 8 housing units cannot charge those families rent exceeding the FMR. However, in the District of Columbia, landlords can charge up to 175% FMR for these units. Therefore, for the DC simulator, if you selected Section 8 subsidies, and enter an amount less than or equal to 175% of the FMR, then it is the familys rent cost when they are no longer eligible for Section 8. If you enter an amount more than 175% of the FMR, then it is the familys rent cost at all income levels, because that rent will be too high for coverage under Section 8. If you did not select Section 8, then the below selection reflects the familys rent cost at all income levels.\r\n',0),
	(216,0,'',0),
	(223,94,'<p>The simulator considers a two-parent traditional work schedule as one in which the second parent does not begin working until the first parent works full-time. Users modeling nontraditional schedules can are asked <b> how many hours the first parent works before the second parent begins working </b>. </p><p> For families working nontraditional schedules, the term <b>shift</b> is the block of time that a parent works continuously in a day. The simulator will add shifts to the same day only after each day in a parents workweek includes one shift.</p><p>Users can also think about shifts during the same day as being different jobs that a parent works that day. The simulator assumes that shifts or jobs are not spread far enough apart for a parent to return home between jobs or shifts.</p><p> Also related to nontraditional schedules, but only for two-parent families, the simulator assumes that <b>when one parent is home while the other is working</b>, the parent at home is available care for their child(ren). </p><p> See our <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for more information. </p>',0),
	(204,38,'<u>Enter costs per child:</u> Users can enter child care rates in these boxes if they wish to model different rates than the standard ones we provide.  The amount entered per child should be the amount the family will pay per day as long as any amount of unsubsidized child care is needed that day. To indicate that parents do not pay for child care, enter $0 in these boxes. <br>\r\n\r\nFor more information about how the simulator calculates child care costs, please see the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.</p>',0),
	(205,33,'For users modeling the impact of Child Care and Development Fund (CCDF) subsidies, the <b> settings where each child receives subsidized care </b> usually do not impact child care expenses, since those expenses for families participating in this program usually consist only of co-payments determined by state agencies rather than provider fees. <br>\r\n\r\nKnowing the setting where children receive subsidized care is helpful, however, because it shows how the CCDF program helps decrease family expenses.\r\n\r\nSee the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for more information, including an explanation of the rare cases when the selection of setting can affect subsidized child care costs. \r\n',0),
	(207,37,'Families selecting to model the impact of Child Care and Development Fund (CCDF) subsidies must also choose the <b>setting for unsubsidized care </b>when the family is not eligible for these subsidies. In lieu of an official market rate survey, the rates for the 2017 District of Columbia simulator are the provider payment rates for the Districts child care subsidy program, based on designations according to the Districts quality rating system. <br>\r\nThe rates included in the 2017 District of Columbia simulator are for full-time care during traditional working hours for each selected setting. The simulator will adjust the daily costs for child care within a given setting if part-time care, care during nontraditional hours, or more than full-time care is needed. See the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for more information.\r\n',0),
	(208,29,'In lieu of an official market rate survey, the <b>child care costs </b> for the 2017 District of Columbia simulator are based on the provider payment rates for the Districts child care subsidy program, based on designations according to the Districts quality rating system. \r\nThe rates included in the 2017 District of Columbia simulator are for full-time care during traditional working hours for each selected setting. The simulator will adjust the daily costs for child care within a given setting if part-time care, care during nontraditional hours, or more than full-time care is needed. See the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>  for more information.\r\n',0),
	(209,30,'<u>Enter costs per child:</u> Users can enter child care rates in these boxes if they wish to model different rates than the standard ones we provide.  The amount entered per child should be the amount the family will pay per day as long as any amount of unsubsidized child care is needed that day. To indicate that parents do not pay for child care, enter $0 in these boxes. <br>\r\n\r\nFor more information about how the simulator calculates child care costs, please see the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.</p>',0),
	(210,18,'Select <b>work supports</b> to indicate which work supports and benefits the family should receive when eligible. Please see our <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a> for a more in-depth discussion of these programs and how the simulator assesses eligibility and benefit receipt.<br>\r\nThe 2017 simulator for the District of Columbia also includes several questions about how a family engages in the TANF cash assistance program, and questions that allow the user to model changes in the TANF, to simulate potential policy changes. Answers to these questions can affect TANF eligibility, the amount of TANF benefits a family can receive, and family expenses. \r\n',0),
	(212,45,'   If you selected public health insurance in Step 4, your selection below for private health insurance applies to the family only when they reach incomes greater than public health insurance eligibility levels. Income eligibility limits for public health insurance are lower for parents than for children, so at some earnings levels, children have access to public coverage while parents need a private plan.<br>\r\n    If you did not select public health insurance, your selection below reflects health insurance costs across all earnings levels. These cost estimates are for premiums only, not copayments or other out-of-pocket expenses, and do not include premium tax credits.<br>\r\nFor more information about how the simulator calculates health care costs, please see the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.\r\n\r\n\r\n',0);
