	(17,'Child care rates by setting reflect provider payment rates from the state child care subsidy program (not the copayment that the family pays when care is subsidized).   For more information, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.',0),
	(18,'Child care rates by setting reflect provider payment rates from the state child care subsidy program. \r\n',0),
	(21,'Private health insurance cost estimates include insurance premiums only, not copayments or other out-of-pocket expenses. For more information, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.',0),
	(22,'Private health insurance cost estimates include insurance premiums only, not copayments or other out-of-pocket expenses. For more information, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.',0),
	(23,'Children in Illinois are eligible for public health insurance regardless of family income, but at higher income levels, premiums may exceed the cost of private coverage. Public coverage for parents is subject to income limits. The Family Resource Simulator assumes that parents shift to private coverage when ineligible for public insurance, and children switch when it is cheaper to do so (based on option chosen above). If the family does not have access to private insurance, parents will become uninsured when ineligible for public coverage, while children will remain in public coverage at all income levels and pay relevant premiums.</p></br><p>Private health insurance cost estimates include insurance premiums only, not copayments or other out-of-pocket expenses. For more information, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.</p>',0),
	(69,'Private health insurance cost estimates include insurance premiums only, not copayments or other out-of-pocket expenses. For more information, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.<br /><br />New York offers a state-subsidized plan called Healthy NY to working adults (and spouses) who do not have employer-based coverage and whose income is below about 250 percent of the poverty level, but above the limit for free public coverage. The Simulator assumes that eligible parents are covered by Healthy NY (and pay relevant premiums) unless \"employer-based plan\" (or an \"other cost estimate\" that is less expensive than Healthy NY) is selected above.',0),
	(77,'In addition to Washington\'s state child care subsidy program, Seattle has a city-funded child care subsidy program for families with a higher income eligibility limit. However, there is a long waiting list for enrollment.  This program is not reflected in the Family Resource Simulators results.',0),
	(79,'In addition to New York\'s state child care subsidy program, Albany, Rochester, and New York City have child care subsidy pilot programs for families with higher income eligibility limits. These programs are not reflected in the Family Resource Simulators results.',0),
	(71,'Child Health Plus B is the name of one New York\'s public health insurance plans for children; children ineligible for public coverage may also enroll in this plan if they pay the full (unsubsidized) premium.',0),
	(27,'Private health insurance cost estimates include insurance premiums only, not copayments or other out-of-pocket expenses. For more information, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.\r\n',0),
	(28,'For more information about the Family Resource Simulator&rsquo;s expense estimates, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_guide#C2\">Calculating Family Expenses</a>.\r\n',0),
	(34,'While the Simulator allows users to select work supports individually, in practice, all families receiving TANF cash assistance in Delaware are provided with CCDF subsidies if needed.',0),
	(38,'In Delaware, subsidies can only be used for relative care in special circumstances (e.g., if the family lives in a rural area with limited care options).',0),
	(40,'Child care assistance generally is available to TANF families and \r\nsome other selected priority groups; limited funding for child care forced the District of Columbia to create a waiting \r\nlist in 2002 for working families seeking child care assistance. ',0),
	(65,'Due to a limited supply of federal housing \r\nvouchers, families applying for housing assistance in DC typically are placed on a waiting list. As of January 2005, \r\nthere were approximately 43,000 applicants on a waiting list for housing vouchers in DC&#151;almost five times the number \r\nof households who have vouchers.',0),
	(42,'While the Simulator allows users to select work supports individually, in practice, families receiving TANF cash assistance in Illinois automatically receive public health insurance and are provided with CCDF subsidies if needed.',0),
	(45,'Simulator applies TANF eligibility rules that apply before families hit Connecticut&rsquo;s 21-month time limit; families who reapply after 21 months face stricter eligibility criteria.  While receiving TANF, families are guaranteed CCDF subsidies if child care is needed to meet TANF work requirements.',0),
	(47,'While the Simulator allows users to select work supports individually, in practice, families receiving TANF cash assistance in Massachusetts are provided with CCDF subsidies if needed.',0),
	(49,'In Maryland Simulator results, the local EITC will be displayed \r\nseparately only for Rockville (Montgomery County), where there is a refundable local credit.  In results for other cities, the value of local EITCs, which are nonrefundable, will be reflected in the family\'s tax liability.',0),
	(51,'In addition to its Medicaid program for families, Pennsylvania\r\nhas a state-funded public health insurance program for parents with a higher income eligibility limit.\r\nHowever, there is a long waiting list for enrollment.  As of May 2004, the state was only enrolling persons who had\r\napplied before the end of March 2003.  This program is not reflected in the Family Resource Simulator&#146;s results.',0),
	(53,'While the Simulator allows users to select work supports individually, in practice, all families receiving TANF cash assistance in Texas are provided with CCDF subsidies if needed.',0),
	(74,'This graph displays total family resources (in the left hand columns) next to basic family expenses (in the right hand columns) as the family\'s earnings increase from $0 to state median income. For information about how resources and expenses are calculated, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_resources\">Calculating Family Resources</a> and <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>. For DC 2017, see the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.',1),
	(80,'This graph shows the level and composition of family resources as the family\'s earnings increase from $0 to just above the state median income. Only cash and near-cash (i.e., food stamps) resources are included. For information about how resources are calculated, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_resources\">Calculating Family Resources</a>.',0),
	(75,'This graph displays net family resources as the family\'s earnings increase from $0 to the state median income. The green line represents the net resources available to the family after subtracting basic expenses. The red horizontal line represents the &ldquo;break even&rdquo; line, where the family&rsquo;s total resources are equal to basic expenses; asterisks indicate where the family reaches this point. For more information about how resources and expenses are calculated, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_resources\">Calculating Family Resources</a> and <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>. For DC 2017, see the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.',1),
	(76,'This graph indicates the family&rsquo;s receipt of benefits as earnings increase from $0 to the state median income. Only benefits the user selected in Step 4 are displayed (if no benefits are selected, this graph will not be displayed). Benefits that have an asset eligibility test are marked by a caret next to the benefit name. As with the other graphs, results will vary based on user choices regarding family characteristics, income sources and assets, benefit participation, and family expenses. For DC 2017, see the <a onclick= \"popup(this, \'scrollbars=1,toolbar=1\', 600, 700); return false;\" target=\"blank\" href=\"/publications/pdf/frstechnicalmanual2017.pdf\">Technical Manual</a>.',1),
	(81,'This graph displays total family resources (in the left hand columns) next to basic family expenses (in the right hand columns) as the family\'s earnings increase from $0 to just above the state median income. For information about how resources and expenses are calculated, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_resources\">Calculating Family Resources</a> and <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>.',0),
	(90,'As of September 2008, enrollment in New Mexico\'s State Coverage Insurance program is closed.',0),
	(83,'This graph indicates the family&rsquo;s receipt of benefits as earnings increase from $0 to just above the state median income. Only benefits the user selected in Step 4 are displayed (if no benefits are selected, this graph will not be displayed). Benefits that have an asset eligibility test are marked by a caret next to the benefit name. As with the other graphs, results will vary based on user choices regarding family characteristics, income sources and assets, benefit participation, and family expenses.',0),
	(86,'Illinois family public health insurance program is currently under litigation. Simulator results reflect an income limit for parents of 185% FPL, which our sources indicate is the most likely outcome.',0),
	(89,'This graph displays net family resources as the family\'s earnings increase from $0 to just above the state median income. The green line represents the net resources available to the family after subtracting basic expenses. The red horizontal line represents the &ldquo;break even&rdquo; line, where the family&rsquo;s total resources are equal to basic expenses; asterisks indicate where the family reaches this point. For more information about how resources and expenses are calculated, see <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_resources\">Calculating Family Resources</a> and <a onclick=\"popup(this, \'scrollbars=1\', 600, 700); return false;\" target=\"blank\" href=\"/popup.php?name=frs_methods_expenses\">Calculating Family Expenses</a>. ',0),
	(88,'While the Simulator allows users to select work supports individually, in practice, families receiving TANF cash assistance in Illinois are automatically provided with CCDF subsidies if needed.',0);
