INSERT INTO `nccp_tool` (`id`, `name`, `description`, `fact`, `url`, `sequence`, `image`, `header_photo`)
VALUES
	(2,'Family Resource Simulator','The Family Resource Simulator shows the impact of federal and state \"work support\" benefits on the budgets of low- to moderate-income families. Results illustrate how a hypothetical family\'s resources change as earnings increase, taking public benefits into account. ',0,'/tools/frs',50,'jpg','jpg'),
	(22,'50-State Policy Tracker','The NCCP 50-State Policy Tracker is a unique, online tool allowing policymakers, journalists, social researchers, and advocates to quickly and accurately compare state policies and programs vital to the well-being of low-income families. It includes key state data for 10 important social programs:  child care subsidies, Child and Dependent Care Tax Credit, Earned Income Tax Credit, family and medical leave, income tax policy, Medicaid/Children?s Health Insurance Program, minimum wage, Supplemental Nutrition Assistance Program (SNAP), Temporary Assistance to Needy Families (TANF), Unemployment Insurance.   ',0,'/tools/policy',10,'jpg',''),
	(8,'50-State Demographics Data Generator','Use the 50-State Demographics Data Generator to create custom tables of national- and state-level statistics about low-income or poor children.  Choose areas of interest, such as parental education, parental employment, marital status, and race/ethnicity&mdash;among many other variables.\r\n',0,'/tools/demographics',20,'jpg','jpg'),
	(9,'Income Converter','Use the Income Converter to convert values among federal poverty guidelines, state median income, and annual income (in dollars).',0,'/tools/converter',60,'jpg','jpg'),
	(14,'Basic Needs Budget Calculator','The Basic Needs Budget Calculator shows how much a family needs to make ends meet. Select state and city (or county), number of parents, and number and ages of children, and the Budget Calculator calculates the cost of minimum daily necessities.',0,'/tools/frs/budget.php',40,'jpg','jpg'),
	(17,'Young Child Risk Calculator','The Young Child Risk Calculator shows how many young children in a state face individual risks as well as multiple risks in combination with economic hardship. These risks are associated with poor health and educational outcomes. Users can select a state, age group, any number of individual risks, and a level of economic hardship.',0,'/tools/risk/',30,'png',''),
	(18,'Mental Health Tracker','The mental health tracker shows the prevalence of mental health problems and illness, patterns of treatment and service use, and cost of mental health care for children, adults and the elderly in the United States from 2000 to 2007 for the nation and 2000-2005 for 23 states (AL, CA, CT, FL, GA, IL, KY, LA, MD, MA, MI, MO, NJ, NY, NC, OH, OK, OR, PA, SC, TX, VA and WI).',0,'/tools/mental-health/',0,'png','');
